This page shows the results of a fluorescence-based enzyme activity assay with:
- A linear standard curve with excellent fit (R² = 0.998)
- Results for a blank, reference standard, and test sample
- All samples processed with 100,000-fold dilution
- Final activities calculated in U/mL units
- Reference activity of 85 U/mL used as control

